import{_ as e,c as a,o as i,aj as o,b6 as s,b7 as r,b8 as l,b9 as n,ba as c,bb as d,bc as p,bd as m,aC as h,aD as g,be as u,bf as y,bg as _,at as f,bh as v,bi as b}from"./chunks/framework.D6_Aedov.js";const C=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"idagio.md","filePath":"idagio.md"}'),I={name:"idagio.md"};function x(A,t,w,k,D,P){return i(),a("div",null,[...t[0]||(t[0]=[o('<h2 id="_1-preparation" tabindex="-1">1. Preparation <a class="header-anchor" href="#_1-preparation" aria-label="Permalink to “1. Preparation”">​</a></h2><p>Before using the IDAGIO music service, you need to prepare a valid IDAGIO account.</p><p>For first-time users, open IDAGIO on your device under &quot;Streaming&quot; - &quot;Music&quot;, or open it in the Eversolo Control app under &quot;Discover&quot; - &quot;Music Services&quot;. Follow the on-screen prompts to complete login.</p><div class="two-images"><img src="'+s+'" alt=""><img src="'+r+'" alt=""></div><h2 id="_2-log-in" tabindex="-1">2. Log In <a class="header-anchor" href="#_2-log-in" aria-label="Permalink to “2. Log In”">​</a></h2><p>Please enter your IDAGIO account and password on your device or Eversolo Control APP to log in.</p><p>If you haven&#39;t created a IDAGIO account yet, please register on the IDAGIO official website: <a href="https://app.idagio.com/discover" target="_blank" rel="noreferrer">https://app.idagio.com/discover</a> , or on the IDAGIO official app.</p><div class="two-images"><img src="'+l+'" alt=""><img src="'+n+'" alt=""></div><h2 id="_3-browsing" tabindex="-1">3. Browsing <a class="header-anchor" href="#_3-browsing" aria-label="Permalink to “3. Browsing”">​</a></h2><p>After successfully logging in, you can browse IDAGIO music on your device or the Eversolo Control APP. At the top of the interface, you will see sections for Discover, Explore, Mood, Recently Played, Collection.</p><p>You can browse these categories layer by layer to access various IDAGIO music recommendations. In Collection section, you can also view your saved tracks, works, playlists, albums, tracks, artists.</p><div class="two-images"><img src="'+c+'" alt=""><img src="'+d+'" alt=""></div><h2 id="_4-search" tabindex="-1">4. Search <a class="header-anchor" href="#_4-search" aria-label="Permalink to “4. Search”">​</a></h2><p>Click the search box at the top to search the entire IDAGIO music library for Artists, Ensembles, Works, Albums, Playlists and other content you want, quickly locating your desired music resources.</p><div class="two-images"><img src="'+p+'" alt=""><img src="'+m+'" alt=""></div><div class="center-text">[Dual-end demonstration of the device and Eversolo Control] </div><h2 id="_5-more" tabindex="-1">5. More <a class="header-anchor" href="#_5-more" aria-label="Permalink to “5. More”">​</a></h2><p>In the browsing interface, you can access the more functions menu by clicking the &quot;<img class="imgIcon" src="'+h+'" alt="">&quot; icon to the right of the track, or the &quot;<img class="imgIcon" src="'+g+'" alt="">&quot; icon in the upper right corner of the album/playlist.</p><p>This menu supports the following functions:</p><table tabindex="0"><thead><tr><th style="text-align:left;">More menus for singles</th><th style="text-align:left;">More menus for albums/playlists</th></tr></thead><tbody><tr><td style="text-align:left;">Play now / Play next</td><td style="text-align:left;">Play all tracks now</td></tr><tr><td style="text-align:left;">Add to the end of play queue</td><td style="text-align:left;">Add all tracks to the next play</td></tr><tr><td style="text-align:left;">Add to device playlist</td><td style="text-align:left;">Add all tracks to the end of play queue</td></tr><tr><td style="text-align:left;">Favorite to IDAGIO</td><td style="text-align:left;">Add to device playlist</td></tr><tr><td style="text-align:left;">Add to playlist</td><td style="text-align:left;">Favorite to IDAGIO</td></tr><tr><td style="text-align:left;">/</td><td style="text-align:left;">Add to IDAGIO playlist</td></tr></tbody></table><p><strong>Tips:</strong></p><ul><li>Saved content can be viewed and managed at any time in the &quot;Collection&quot; section.</li><li>Content added to the device playlist can be viewed and managed centrally in My Favorites- Device playlists.</li></ul><div class="two-images"><img src="'+u+'" alt=""><img src="'+y+'" alt=""></div><div class="center-text">[Dual-end demonstration of the device and Eversolo Control] </div><h2 id="_6-streaming-quality" tabindex="-1">6. Streaming Quality <a class="header-anchor" href="#_6-streaming-quality" aria-label="Permalink to “6. Streaming Quality”">​</a></h2><p>When playing IDAGIO music, you can click the &#39;<img class="imgIcon" src="'+_+'" alt="">&#39; icon in the top right corner of the homepage, or click the &#39;<img class="imgIcon" src="'+f+'" alt="">&#39; icon on the playback details interface to select the streaming quality mode.</p><p>Supported options include:</p><ul><li>Low</li><li>Medium（128 kb/s）</li><li>Hight（320 kb/s）</li><li>Lossless（CD-Quality）</li><li>HiRes（Master）</li></ul><div class="two-images"><img src="'+v+'" alt=""><img src="'+b+'" alt=""></div><div class="center-text">[Dual-end demonstration of the device and Eversolo Control] </div>',30)])])}const O=e(I,[["render",x]]);export{C as __pageData,O as default};
